    [],nt"revision_timestamp": "2016-05-31T01:05:49.477582",nt"name": "national-status-and-trends-bioeffects-assessment-program-sites-1986-to-present-compiled-from-no",nt"isopen":
    false,nt"url": null,nt"notes": "This dataset contains sample collection
    location information for the National Status and Trends, Bioeffects Assessment Project.
    The Bioeffects Assessment Sites data files report information regarding the planned
    sampling locations designated by the planners for the monitoring program. At present
    about thirty Bioeffects Assessments have been conducted as part of NSandT's Bioeffects
    Assessment Project. This SITES file only contains site information for the St. Lucie
    Estuary Study (2001). Site information for the other studies will be added over
    time beginning with the Chesapeake Bay Study (1998, 1999, 2001). One record is presented
    per site. Each record reports the planned values of latitude and longitude and the
    actual values recorded at the time of sampling, five letter site acronym, site sequence
    number, general and specific location information, state abbreviation, state name,
    degree-minute-second coordinates, decimal degree coordinates, and species information,
    among other things. The actual site coordinate information is recorded at the time
    of sampling, if samples were taken at a location other than the nominal site center.
    The five letter acronym is based on both the general location information and more
    specific location information (e.g. SFSM is San Francisco-San Mateo Bridge). The
    file also contains sequence numbers that facilitate geographic manipulation of the
    data. Sites are numbered sequentially from the northernmost site on the U.S. East
    coast and continue counter-clockwise around the country.",nt"license_title":
